import React from "react";
import "./VideoRow.css";
function VideoRow({ views, subs, description, timestamp, title, image }) {
  return (
    <div className="videoRow">
      <img src={image} alt=""></img>
      <div className="videoRow__text">
        <h3>{title}</h3>
      </div>
    </div>
  );
}

export default VideoRow;
